import React from "react";
import './App.css';
 
export class App extends React.Component{
    state={
        phone:"iphone 14 plus",
        cost: 79999
    }
    render(){
        return(
            <div>
                <h1>Hai , Welcome to class componenet bind concept</h1>
                <h2>phone : {this.state.phone}</h2>
                <h2>cost : {this.state.cost}</h2>
                <input type="number" id="cost"></input>
                <button>click to update the counter value</button>
            </div>
        )
    }
}
